import React, { useEffect } from 'react';
import { withRouter } from 'react-router-dom';

function UserSignOut({ context }) {
  useEffect(() =>  context.actions.signOut());

  return (
    this.props.history.push('/')
  );
}

export default withRouter(UserSignOut);
